import './App.css';
import React from "react"
import StudentCreate from "./component/student/StudentCreate";
import {ToastContainer} from "react-toastify";
import 'react-toastify/dist/ReactToastify.css';
import {BrowserRouter, NavLink, Route, Routes} from "react-router-dom";
import StudentListFunction from "./component/student/StudentListFunction";


function App() {
    return (
        <>
            <BrowserRouter>
                <div>
                    <NavLink to="/student">Danh sách</NavLink>
                    <NavLink to="/create">Thêm mới</NavLink>
                </div>
                <Routes>
                    <Route path="/create" element={<StudentCreate />} />
                    <Route path="/student" element={<StudentListFunction/>} />
                </Routes>
            </BrowserRouter>
            <ToastContainer />
        </>
    );
}

export default App;
